/** @format */

import React from "react";
import "../../styles/find-car-form.css";
import { Form, FormGroup, Label, Input, Button } from "reactstrap";

const FindCarForm = () => {
  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Form submitted!");
  };

  return (
    <Form className="form" onSubmit={handleSubmit}>
      <div className="d-flex align-items-center justify-content-between flex-wrap">
        <FormGroup className="form__group">
          <Label for="carName">Tên phương tiện</Label>
          <Input
            id="carName"
            type="text"
            placeholder="Nhập tên phương tiện"
            required
          />
        </FormGroup>

        {/* Loại xe */}
        <FormGroup className="select__group">
          <Label for="carType">Loại xe</Label>
          <Input id="carType" type="select" required>
            <option value="sedan">Sedan</option>
            <option value="suv">SUV</option>
            <option value="mpv">MPV</option>
          </Input>
        </FormGroup>

        {/* Hãng xe */}
        <FormGroup className="select__group">
          <Label for="carType">Hãng xe</Label>
          <Input id="carType" type="select" required>
            <option value="toyota">Toyota</option>
            <option value="honda">Honda</option>
            <option value="ford">Ford</option>
            <option value="mercedes">Mercedes-Benz</option>
            <option value="bmw">BMW</option>
            <option value="audi">Audi</option>
            <option value="hyundai">Hyundai</option>
            <option value="chevrolet">Chevrolet</option>
            <option value="nissan">Nissan</option>
            <option value="kia">Kia</option>
          </Input>
        </FormGroup>

        {/* Ngày thuê */}
        <FormGroup className="form__group">
          <Label for="rentalDate">Ngày thuê</Label>
          <Input id="rentalDate" type="date" required />
        </FormGroup>

        {/* Ngày trả */}
        <FormGroup className="form__group">
          <Label for="rentalDate">Ngày trả</Label>
          <Input id="rentalDate" type="date" required />
        </FormGroup>

        {/* Giờ thuê */}
        <FormGroup className="form__group">
          <Label for="rentalTime">Giờ thuê</Label>
          <Input id="rentalTime" type="time" required />
        </FormGroup>

        {/* Nút tìm xe */}
        <FormGroup className="form__group">
          <Button className="btn find__car-btn" type="submit">
            Tìm xe
          </Button>
        </FormGroup>
      </div>
    </Form>
  );
};

export default FindCarForm;
